import React from "react";
import { Link } from "react-router-dom";
import '../styles/Header.scss';

export default function Header() {
  return(
    <header>
      <div className="logo"><h1>Portfolio</h1></div>
      <ul className="navigation">
        <li className="link"><Link to='/' className="nav-btn">ホーム<br/><p className="sub-title">Home</p></Link></li>
        <li className="link"><Link to='/works' className="nav-btn">作品<br/><p className="sub-title">works</p></Link></li>
        <li className="nav-btn link"><Link to='/experience' className="nav-btn">経歴<br/><p className="sub-title">Experience</p></Link></li>
        <li className="link"><Link to='/contact' className="nav-btn">お問い合わせ<br/><p className="sub-title">Contact</p></Link></li>
      </ul>
    </header>
  );
}
